import React, { useState } from "react";
import "./styles.css";

const PasswordComponent = (setPassword) => {
  return (
    <div>
      <input
        className="Layout"
        type="password"
        placeholder="Enter an password"
        onChange={(e) => setPassword(e.target.value)}
      />
    </div>
  );
};

export default PasswordComponent;
